import React from 'react';
import { Link } from "react-router-dom";
import "./BotonInicio.scss";

export default function BotonInicio() {
    return (
        <button class="button-inicio">
            <Link to="/" className="irTramite">
                <p></p>
            </Link>
        </button>
    )
}
